import React from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import './App.css';


//import Navigator from './components/Navigator'
import CompProductsCrear  from './components/productos/ProductsCrear';
import ProductsList from './components/productos/ProductsList'
import CompProductsEditar from './components/productos/ProductsEditar';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/producto/buscarall' element={<ProductsList/>}/>
        <Route path='/producto/crear' element={<CompProductsCrear/>}/>
        <Route path='/producto/actualizar/:id' element={<CompProductsEditar/>}/>
      </Routes>
    </Router>
  );
}

export default App;
